tables.table_schema:
CREATE TABLE incidents (
    incident_id UUID PRIMARY KEY,
    date TIMESTAMP,
    location VARCHAR,
    description TEXT
);

CREATE TABLE emergency_teams (
    team_id UUID PRIMARY KEY,
    team_name VARCHAR,
    team_lead VARCHAR,
    location VARCHAR
);

CREATE TABLE FireIncidents (
  incident_id UUID PRIMARY KEY,
  incident_date TIMESTAMP,
  location VARCHAR,
  severity INT
);

CREATE TABLE EmergencyResponseTeams (
  team_id UUID PRIMARY KEY,
  team_name VARCHAR,
  team_lead VARCHAR,
  team_members INT
);

CREATE TABLE fire_incidents (
  incident_id INT PRIMARY KEY,
  incident_date DATE,
  location VARCHAR(50),
  description TEXT
);

CREATE TABLE emergency_teams (
  team_id INT PRIMARY KEY,
  team_name VARCHAR(50),
  team_leader VARCHAR(50),
  team_size INT
);

CREATE TABLE team_assignments (
  assign_id INT PRIMARY KEY,
  incident_id INT,
  team_id INT,
  assignment_date DATE
);

CREATE TABLE team_status (
  status_id INT PRIMARY KEY,
  team_id INT,
  status VARCHAR(50),
  last_updated TIMESTAMP
);

CREATE TABLE IncidentDetails (
    incident_id UUID PRIMARY KEY,
    incident_date DATE,
    incident_location VARCHAR(255),
    incident_description TEXT
);

CREATE TABLE EmergencyTeams (
    team_id UUID PRIMARY KEY,
    team_name VARCHAR(255),
    team_leader VARCHAR(255),
    team_contact_number VARCHAR(15)
);

CREATE TABLE TeamMembers (
    member_id UUID PRIMARY KEY,
    team_id UUID,
    member_name VARCHAR(255),
    member_contact_number VARCHAR(15)
);

CREATE TABLE IncidentLogs (
    log_id UUID PRIMARY KEY,
    incident_id UUID,
    log_timestamp TIMESTAMP,
    log_description TEXT
);
